INSERT INTO public.npc VALUES (41, 'Samanta Orlandini', 1, 1, 45, NULL, 3, 6, 3, 5, 2, 1, 2, NULL, 25, 14, 7, 9, 0.6450336781, 0.6579000289, 0.6222895237, 0.5585224425, 0.1807498952, 0.8315422316, 0.7418443323, 0.8618781496, 0.1016344326, 0.8550616740, 0.3972894761, 'Atacada por Ilinca Gogean.', 2, 5, 5, 1, 'Chapéu de cowboy. Botas. Corpo torneado. Sorriso largo. Faixa no torso. Segurando a cabeça.', true, true, false, 'Predadora sexual. Rouba os homens que tem casos.');
