INSERT INTO public.npc VALUES (19, 'Elide Pergola', 1, 1, 6, NULL, 3, 6, 2, 5, 1, 1, 1, 27, 11, 17, 11, 10, 0.3114835651, 0.0591682096, 0.4136594005, 0.1895005145, 0.0249218814, 0.7158808625, 0.5110050159, 0.5098742079, 0.6708147721, 0.7935724505, 0.6895371727, NULL, 2, 4, 4, 1, 'Camiseta azul. Calça Jeans.', true, false, false, 'Muito competitiva na escola.');
